import React from "react";
import { Grid } from "@material-ui/core";

function Footer() {
  return (
    <Grid container spacing={1} className="my-20 px-10">
      <Grid item md={2}></Grid>
      <Grid container md={8}>
        <Grid item md={3}>
          <h5>Address</h5>
          <p>350 5th Ave, New York, NY 10118, USA</p>
        </Grid>
      </Grid>
      <Grid item md={2}></Grid>
    </Grid>
  );
}

export default Footer;
